import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { Router } from '@angular/router';
import { UserService } from '../../services/user.service';

@Component({
  selector: 'app-edit-profile',
  templateUrl: './edit-profile.component.html',
  styleUrls: ['./edit-profile.component.css']
})
export class EditProfileComponent implements OnInit {

  editForm!: FormGroup;
  loading = false;

  constructor(
    private fb: FormBuilder,
    private userService: UserService,
    private router: Router
  ) {}

  ngOnInit(): void {
    this.editForm = this.fb.group({
      fullName: ['', Validators.required],
      email: [{ value: '', disabled: true }]
    });

    this.loadProfile();
  }

  loadProfile(): void {
  this.userService.getProfile().subscribe({
    next: (res: any) => {
      this.editForm.patchValue({
        fullName: res.fullName,
        email: res.email
      });
    },
    error: () => {
      alert('Failed to load profile');
    }
  });
}


  submit(): void {
    if (this.editForm.invalid) return;

    this.loading = true;

    const payload = {
      fullName: this.editForm.get('fullName')?.value
    };

    this.userService.updateProfile(payload).subscribe({
      next: () => {
        alert('Profile updated successfully');
        this.router.navigate(['/profile']);
      },
      error: () => {
        alert('Failed to update profile');
        this.loading = false;
      }
    });
  }

  cancel(): void {
    this.router.navigate(['/profile']);
  }
}
<div class="edit-profile-wrapper">
  <div class="edit-profile-card">

    <h2>Edit Profile</h2>

    <form [formGroup]="editForm" (ngSubmit)="submit()">

      <div class="form-group">
        <label>Full Name</label>
        <input
          type="text"
          class="form-control"
          formControlName="fullName"
          placeholder="Enter full name"
        />
        <small *ngIf="editForm.get('fullName')?.invalid && editForm.get('fullName')?.touched">
          Name is required
        </small>
      </div>

      <div class="form-group">
        <label>Email</label>
        <input
          type="email"
          class="form-control"
          formControlName="email"
        />
      </div>

      <div class="actions">
        <button type="submit" class="btn save-btn" [disabled]="loading">
          Save Changes
        </button>

        <button type="button" class="btn cancel-btn" (click)="cancel()">
          Cancel
        </button>
      </div>

    </form>

  </div>
</div>
